import "./Login.css";
import Navbar from "../../components/navbar/Navbar";

const Login = () => {
  return (
    <div>
      <Navbar />
      <div className="container">
        <h1>Login</h1>
        <form action="" className="container">
          <input type="text" placeholder="Username" />
          <input type="password" placeholder="Password" />
          <button>Login</button>
        </form>
      </div>
    </div>
  );
};

export default Login;
